CREATE DATABASE Libro_Capitulo7;

CREATE TABLE ALUMNOS (
  DNI_Al CHARACTER(9) NOT NULL,
  Nombre_Al CHARACTER(50) NOT NULL,
  Apellido1_Al CHARACTER(50) NOT NULL,
  Apellido2_Al CHARACTER(50) NOT NULL,
  Edad_Al INTEGER,
  Telefono_Al CHARACTER(9),
  Direccion_Al CHARACTER(100),
  Ciudad_Al CHARACTER(20),
  PRIMARY KEY (DNI_Al)
);

CREATE TABLE Profesores (
  DNI_P CHARACTER(9) NOT NULL,
  Nombre_P CHARACTER(50) NOT NULL,
  Apellido1_P CHARACTER(50) NOT NULL,
  Apellido2_P CHARACTER(50) NOT NULL,
  NCuenta_P CHARACTER(20),
  Telefono_P CHARACTER(9),
  Especialidad_P CHARACTER(20),
  Direccion_P CHARACTER(100),
  Ciudad_P CHARACTER(20),
  PRIMARY KEY (DNI_P)
);

CREATE TABLE Asignaturas (
  Cod_As INTEGER NOT NULL,
  Nombre_As CHARACTER(50) NOT NULL,
  Creditos_As INTEGER NOT NULL,
  Facultad_As CHARACTER(50),
  DNI_P CHARACTER(9) REFERENCES Profesores(DNI_P) ON UPDATE CASCADE ON DELETE CASCADE, PRIMARY KEY (Cod_As)
);

CREATE TABLE Estudian (
  DNI_A1 CHARACTER(9) NOT NULL REFERENCES Alumnos(DNI_Al) ON UPDATE CASCADE ON DELETE CASCADE,
  Cod_As INTEGER NOT NULL REFERENCES Asignaturas(Cod_As) ON UPDATE CASCADE ON DELETE CASCADE,
  Nota_A1_As INTEGER,
  PRIMARY KEY (DNI_A1, Cod_As)
);

ALTER TABLE Estudian ADD Convocatoria_A1_As INT;

CREATE VIEW Tnfno_Profe AS SELECT Nombre_P, Telefono_P FROM Profesores;

SELECT * FROM Profesores;

SELECT * FROM Alumnos;

DROP TABLE Alumnos;

DROP TABLE Estudian;

